SELECT SCS.CHILD_NUMBER, SCS.EXECUTIONS, SCS.ROWS_PROCESSED, SCS.BUFFER_GETS, SCS.BIND_SET_HASH_VALUE FROM V$SQL S, V$SQL_CS_STATISTICS SCS WHERE SCS.SQL_ID=S.SQL_ID AND SCS.CHILD_NUMBER=S.CHILD_NUMBER AND S.SQL_TEXT='SELECT T3.C1, T4.C2 FROM T3, T4 WHERE T3.C1 BETWEEN :N1 AND :N2 AND T3.C1=T4.C1' ORDER BY SCS.CHILD_NUMBER;

SELECT SCS.CHILD_NUMBER, SUBSTR(SCS.PREDICATE,1,10) PREDICATE, SCS.RANGE_ID, SCS.LOW, SCS.HIGH FROM V$SQL S, V$SQL_CS_SELECTIVITY SCS WHERE SCS.SQL_ID=S.SQL_ID AND SCS.CHILD_NUMBER=S.CHILD_NUMBER AND S.SQL_TEXT='SELECT T3.C1, T4.C2 FROM T3, T4 WHERE T3.C1 BETWEEN :N1 AND :N2 AND T3.C1=T4.C1' ORDER BY  SCS.CHILD_NUMBER, SCS.PREDICATE DESC, RANGE_ID;

SELECT SCS.CHILD_NUMBER, SCS.BUCKET_ID, SCS.COUNT FROM V$SQL S, V$SQL_CS_HISTOGRAM SCS WHERE SCS.SQL_ID=S.SQL_ID AND SCS.CHILD_NUMBER=S.CHILD_NUMBER AND S.SQL_TEXT='SELECT T3.C1, T4.C2 FROM T3, T4 WHERE T3.C1 BETWEEN :N1 AND :N2 AND T3.C1=T4.C1' ORDER BY  SCS.CHILD_NUMBER, SCS.BUCKET_ID;

